import Navbar from "../src/Components/Navbar";
import FlightSearch from "../src/Components/FlightSearch";
import Flights from "../src/Components/Flights";
import SingleFlight from "../src/Components/SingleFlight";
import UserBookings from "../src/Components/UserBookings";
import UserProfile from "../src/Components/UserProfile";

import { Route, Routes } from "react-router-dom";

function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<FlightSearch />} />
        <Route path="/Flights" element={<Flights />} />
        <Route path="/Flights/:flightId" element={<SingleFlight />} />
        <Route path="/Profile" element={<UserProfile />} />
        <Route path="/Bookings" element={<UserBookings />} />
      </Routes>
    </div>
  );
}

export default App;
